gSw(){return"Structure in the World"},
gSy(){return"Its historic and strategic importance is matched only by its architectural significance."},
gSz(){return"UNESCO"},
gSn(){return"The best-known sections of the wall were built by the Ming dynasty (1368-1644)."},
gSo(){return"During the Ming dynasty, however, bricks were heavily used in many areas of the wall, as were materials such as tiles, lime, and stone."},
gSD(){return"\u201cSee China\u2019s Iconic Great Wall From Above | National Geographic.\u201d Youtube, uploaded by National Geographic."},
gSv(){return"Map showing location of Great Wall of China in northern China."},
gSr(){return"The Great Wall of China is a series of fortifications that were built across the historical northern borders of ancient Chinese states and Imperial China as protection against various nomadic groups from the Eurasian Steppe. The total length of all sections ever built is over 13,000 miles."},
gSs(){return"Several walls were built from as early as the 7th century BCE, with selective stretches later joined together by Qin Shi Huang (220-206  BCE), the first emperor of China. Little of the Qin wall remains. \nLater on, many successive dynasties built and maintained multiple stretches of border walls."},
gSp(){return"Transporting the large quantity of materials required for construction was difficult, so builders always tried to use local resources. Stones from the mountains were used over mountain ranges, while rammed earth was used for construction in the plains. Most of the ancient walls have eroded away over the centuries."},
gSq(){return"Stones cut into rectangular shapes were used for the foundation, inner and outer brims, and gateways of the wall. \nUnder the rule of the Qing dynasty, China's borders extended beyond the walls and Mongolia was annexed into the empire, so construction was discontinued."},
gSt(){return"The frontier walls built by different dynasties have multiple courses. Collectively, they stretch from Liaodong in the east to Lop Lake in the west, from the present-day Sino-Russian border in the north to Tao River in the south; along an arc that roughly delineates the edge of the Mongolian steppe."},
gSu(){return"Apart from defense, other purposes of the Great Wall have included border controls, allowing the imposition of duties on goods transported along the Silk Road, regulation or encouragement of trade and the control of immigration and emigration."},
gSk(){return"First landmark of the Great Wall began originally as a square wall surrounding the state of Chu. Over the years, additional walls would be built and added to it to expand and connect territory."},
gSh(){return"The first Qin Emperor unifies China and links the wall of the surrounding states of Qin, Yan, and Zhao into the Great Wall of China, taking 10 years to build with hundreds of thousands of laborers."},
gSf(){return"A 20-year construction project was started by the Han emperor to build east and west sections of the wall, including beacons, towers, and castles. Not just for defense, but also to control trade routes like the Silk Road."},
gSi(){return"The Bei Qi kingdom also launched several construction projects, utilizing over 1.8 million workers to repair and extend sections of the wall, adding to its length and even building a second inner wall around Shanxi."},
gSj(){return"The Great Wall was repaired during the Sui Dynasty and used to defend against Tujue attacks. Before and after the Sui Dynasty, the wall saw very little use and fell into disrepair."},
gSg(){return"Hongzhi Emperor split the walls into north and south lines, eventually shaping it into how it is today. Since then, it has gradually fallen into disrepair and remains mostly unused."},
ga9t(){return"Machu Picchu"},
ga9s(){return"Citadel of the Inca"},
ga9r(){return"Cusco Region, Peru"},
ga9b(){return"Inca"},
ga9c(){return"South America"},
ga9o(){return"Few Romances Can Ever Surpass"},
ga9n(){return"That of the Granite Citadel"},
ga9m(){return"Hiram Bingham"},
ga9p(){return"In the variety of its charms and the power of its spell, I know of no other place in the world which can compare with it."},
ga9q(){return"Hiram Bingham"},
ga9d(){return"During its use as a royal estate, it is estimated that about 750 people lived there, with most serving as support staff who lived there permanently."},
ga9e(){return"The Incas were masters of this technique, called ashlar, in which blocks of stone are cut to fit together tightly without mortar."},
ga9u(){return"\u201cMachu Picchu 101 | National Geographic.\u201d Youtube, uploaded by National Geographic."},
ga9l(){return"Map showing location of Machu Picchu in the Eastern Cordillera of southern Peru."},
ga9h(){return"Machu Picchu is a 15th-century Inca citadel located in the Eastern Cordillera of southern Peru on a 2,430-meter (7,970 ft) mountain ridge. Construction appears to date from two great Inca rulers, Pachacutec Inca Yupanqui (1438\u20131471 CE) and T\xfapac Inca Yupanqui (1472\u20131493 CE)."},
ga9i(){return"There is a consensus among archeologists that Pachacutec ordered the construction of the royal estate for his use as a retreat, most likely after a successful military campaign.\nRather it was used for 80 years before being abandoned, seemingly because of the Spanish conquests in other parts of the Inca Empire."},
ga9f(){return'The central buildings use the classical Inca architectural style of polished dry-stone walls of regular shape. \nInca walls have many stabilizing features: doors and windows are trapezoidal, narrowing from bottom to top; corners usually are rounded; inside corners often incline slightly into the rooms, and outside corners were often tied together by "L"-shaped blocks.'},
ga9g(){return"This precision construction method made the structures at Machu Picchu resistant to seismic activity.\nThe site itself may have been intentionally built on fault lines to afford better drainage and a ready supply of fractured stone."},
ga9j(){return"Machu Picchu is situated above a bow of the Urubamba River, which surrounds the site on three sides, where cliffs drop vertically for 1,480 feet (450 m) to the river at their base. The location of the city was a military secret, and its deep precipices and steep mountains provided natural defenses."},
ga9k(){return"The Inca Bridge, an Inca grass rope bridge, across the Urubamba River in the Pongo de Mainique, provided a secret entrance for the Inca army. Another Inca bridge was built to the west of Machu Picchu, the tree-trunk bridge, at a location where a gap occurs in the cliff that measures 20 feet (6 m)."},
ga95(){return"Speculated to be built and occupied by Inca ruler Pachacuti Inca Yupanqui."},
ga96(){return"The last Inca rulers used the site as a bastion to rebel against Spanish rule until they were ultimately wiped out."},
ga97(){return"Speculated to have been originally discovered by German explorer Augusto Berns, but his findings were never effectively publicized."},
ga98(){return"Introduced to the world by Hiram Bingham of Yale University, who was led there by locals after disclosing he was searching for Vilcabamba, the \u2019lost city of the Incas\u2019."},
ga99(){return"Surrounding sites were excavated thoroughly by Gene Savoy, who found a much more suitable candidate for Vilcabamba in the ruin known as Esp\xedritu Pampa."},
ga9a(){return"Since its rediscovery, growing numbers of tourists have visited the Machu Picchu each year, with numbers exceeding 1.4 million in 2017."},
